import Login from './pages/Login';
import Signup from './pages/Signup';
import Main from './pages/Main';
import { Navigate, useLocation } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css'


import { Routes, Route } from 'react-router-dom';
import './App.css';
import Table from './pages/Table';
import UsersPage from './pages/tables_pages/UsersPage';
import InfopanelAccessPage from './pages/tables_pages/InfopanelAccessPage';
import ReportsPage from './pages/tables_pages/ReportsPage';
import LoadingStorefrontsPage from './pages/tables_pages/LoadingStorefrontsPage';
import AuditPage from './pages/tables_pages/AuditPage';
import OrdersPage from './pages/tables_pages/OrdersPage';
import BillingPage from './pages/tables_pages/BillingPage';
import InfopanelAccessOrganizationPage from './pages/tables_pages/InfopanelAccessOrganizationPage';
import InfopanelAccessIndividualPage from './pages/tables_pages/InfopanelAccessIndividualPage';

function App() {
  return (

    <>
    <Routes>
        <Route path="/main" element={<Main/>}>

        </Route>
    </Routes>
    </>

  );
}

function RequireAuth({ children }) {
  let location = useLocation();
  if (false) {
    return <Navigate to="/" state={{ from: location }} replace />;
  }

  return children;
}

export default App;
